import React from 'react';
import {
  Routes,
  Route,
  BrowserRouter,
} from 'react-router-dom';
import Homepage from './pages/Homepage';
import './style.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
        <h1 className="text-3xl font-bold underline">
      Hello world!
    </h1>
          <Route path="/" element={<Homepage/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
